// Expand contains string like: `Boss/Name`\r\n            if (items.length > 1) {\r\n                const expandName = items[0];\r\n                const propertyName = items[1];\r\n\r\n                if (!expandData.containsKey(expandName)) {\r\n                    expandData.set(expandName, new List());\r\n                }\r\n\r\n                expandData.get(expandName).push(propertyName);\r\n            }\r\n            else {\r\n                // Expand is just a simple string like: `Boss`\r\n                normalSelects.push(select);\r\n            }\r\n        });\r\n\r\n        let params = new HttpParams();\r\n\r\n        const expands = expandData.distinct().select((element) => {\r\n            if (element.value.any()) {\r\n                return `${element.key}(${this.config.keys.select}=${this.toCommaString(element.value)})`;\r\n            }\r\n\r\n            return element.key;\r\n        });\r\n\r\n        if (expands.any()) {\r\n            params = params.append(this.config.keys.expand, this.toCommaString(expands));\r\n        }\r\n\r\n        if (normalSelects.any()) {\r\n            params = params.append(this.config.keys.select, this.toCommaString(normalSelects));\r\n        }\r\n\r\n        return params;\r\n    }\r\n\r\n    protected handleResponse(entity: Observable>): Observable {\r\n        return entity.map(this.extractData)\r\n            .catch((err: any, caught: Observable) => {\r\n                if (this.config.handleError) {\r\n                    this.config.handleError(err, caught);\r\n                }\r\n                return Observable.throw(err);\r\n            });\r\n    }\r\n\r\n    protected getRequestOptions(): {\r\n        headers?: HttpHeaders;\r\n        observe: 'response';\r\n        params?: HttpParams;\r\n        reportProgress?: boolean;\r\n        responseType?: 'json';\r\n        withCredentials?: boolean;\r\n    } {\r\n        const options = Object.assign({}, this.config.defaultRequestOptions);\r\n        options.params = this.getParams();\r\n        return options;\r\n    }\r\n\r\n    protected abstract Exec(...args: any[]): Observable;\r\n\r\n    protected toStringArray(input: string | string[] | IEnumerable | IQueryable): string[] {\r\n        if (!input) {\r\n            return [];\r\n        }\r\n\r\n        if (input instanceof String || typeof input === 'string') {\r\n            return input.split(',').map(s => s.trim());\r\n        }\r\n\r\n        if (input instanceof Array) {\r\n            return input;\r\n        }\r\n\r\n        return input.toArray();\r\n    }\r\n\r\n    protected toCommaString(input: string | string[] | IEnumerable | IQueryable): string {\r\n        if (input instanceof String || typeof input === 'string') {\r\n            return input as string;\r\n        }\r\n\r\n        if (input instanceof Array) {\r\n            return input.join();\r\n        }\r\n\r\n        return input.toArray().join();\r\n    }\r\n\r\n    private extractData(res: HttpResponse): T {\r\n        if (res.status = 300) {\r\n            throw new Error('Bad response status: ' + res.status);\r\n        }\r\n\r\n        const body: any = res.body;\r\n        const entity: T = body;\r\n        return entity || null;\r\n    }\r\n}\r\n\r\nexport abstract class OperationWithKey extends ODataOperation {\r\n    constructor(protected _typeName: string,\r\n        protected config: ODataConfiguration,\r\n        protected http: HttpClient,\r\n        protected entityKey: string | number | boolean) {\r\n        super(_typeName, config, http);\r\n    }\r\n    protected abstract Exec(...args: any[]): Observable;\r\n}\r\n\r\nexport abstract class OperationWithEntity extends ODataOperation {\r\n    constructor(protected _typeName: string,\r\n        protected config: ODataConfiguration,\r\n        protected http: HttpClient,\r\n        protected entity: T) {\r\n        super(_typeName, config, http);\r\n    }\r\n    protected abstract Exec(...args: any[]): Observable;\r\n}\r\n\r\nexport abstract class OperationWithKeyAndEntity extends ODataOperation {\r\n    constructor(protected _typeName: string,\r\n        protected config: ODataConfiguration,\r\n        protected http: HttpClient,\r\n        protected entityKey: string,\r\n        protected entity: T) {\r\n        super(_typeName, config, http);\r\n    }\r\n    protected abstract Exec(...args: any[]): Observable;\r\n}\r\n\r\nexport class GetOperation extends OperationWithKey {\r\n    public Exec(): Observable {\r\n        return super.handleResponse(this.http.get(this.config.getEntityUri(this.entityKey, this.typeName), this.getRequestOptions()));\r\n    }\r\n}\r\n\r\n// export class PostOperation extends OperationWithEntity{\r\n//     public Exec():Observable{    //ToDo: Check ODataV4\r\n//         let body = JSON.stringify(this.entity);\r\n//         return this.handleResponse(this.http.post(this.config.baseUrl + \"/\"+this._typeName, body, this.getRequestOptions()));\r\n//     }\r\n// }\r\n\r\n// export class PatchOperation extends OperationWithKeyAndEntity{\r\n//     public Exec():Observable{    //ToDo: Check ODataV4\r\n//         let body = JSON.stringify(this.entity);\r\n//         return this.http.patch(this.getEntityUri(this.key),body,this.getRequestOptions());\r\n//     }\r\n// }\r\n\r\n// export class PutOperation extends OperationWithKeyAndEntity{\r\n//     public Exec(){\r\n//         let body = JSON.stringify(this.entity);\r\n//         return this.handleResponse(this.http.put(this.getEntityUri(this.key),body,this.getRequestOptions()));\r\n//     }\r\n// }\r\n\n    \n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"/interfaces/IODataResponseModel.html":{"url":"/interfaces/IODataResponseModel.html","title":"interface - IODataResponseModel","body":"\n                   \n\n\n\n\n\n\n\n\n  Interfaces\n  IODataResponseModel\n\n\n\n    \n        Infos\n    \n    \n        Source\n    \n\